import React, { Component } from 'react';
import PlanGraph from './PlanGraph'
import Logo from './Logo'

class Plan extends Component {
	render() {
  return (
    <div>
      <Logo />
      <h2>The crowds for the next 30 days</h2>
      <PlanGraph />
    </div>
  );
}
}

export default Plan;
